from string import count


class Solution(object):
    def isAnagram(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        # nums=[]
        # for x in range(300):
        #     nums.append(0)
        # if len(s) != len(t):
        #     return False
        # for i in range(len(s) - 1):
        #     nums[ord(s[i])] = nums[ord(s[i])] + 1
        #     nums[ord(t[i])] = nums[ord(t[i])] - 1
        # for i in nums:
        #     if i != 0:
        #         return False
        # return True
        temp = set()
        if len(s) != len(t):
            return False
        for i in s:
            if i not in temp:
                temp.add(i)
                if s.count(i) != t.count(i):
                    return False
        return True


